import { createGlobalStyle } from 'styled-components';

export const DynamicStyles = createGlobalStyle`
    body {
    margin: 0 !important;
    display: flex;
    height: 100%;
    
    background-color: ${({ theme }) => theme.backgroundColor};
    
    border-radius: 6px;
}
    .test {
        background-color: ${({ theme }) => theme.backgroundColor};
    }


`;
